jQuery(function($){
   
   "use strict";   
   
   /* ==================================================
   Counter
   ================================================== */
   
   $(document).ready(function(){
      
      var counter = $(".pollen-counter");
      
      $(counter).each(function() {
         
         $(this).appear(function(){
            
            var value = $(this).find('div.pollen-counter-paramns').attr('value');
            var speed = $(this).find('div.pollen-counter-paramns').attr('value-speed');
            var interval = $(this).find('div.pollen-counter-paramns').attr('value-interval');
            
            $(this).find('.pollen-counter-paramns').countTo({
               from: 0,
               to: value,
               speed: speed,
               refreshInterval: interval,
               onComplete: function(){
                  
               }
            });   
            
         });
         
      });
      
   });
   
   
   /* ==================================================
   Testimonial
   ================================================== */
   
   $(document).ready(function(){ 
      
      if($('.pollen-testimonial').length > 0 ){
         var elem = document.querySelector('.main-carousel');
         var flkty = new Flickity( elem, {
            // options
            prevNextButtons: false,
            wrapAround: true,
            autoPlay: true,
            contain: true
         });
         
         // element argument can be a selector string
         //   for an individual element
         var flkty = new Flickity( '.main-carousel', {
            // options
         });
      }
      
   });
   
   
   /* ==================================================
   Progress Bar
   ================================================== */
   
   $(document).ready(function(){ 
      
      $('.pollen-progress-bar-params').each(function(){
         
         $(this).appear(function(){
            
            var percentage_color = $(this).attr('percentage_color');
            var bar_color = $(this).attr('bar_color');
            var track_color = $(this).attr('track_color');
            var percentage = $(this).attr('percentage') / 100;
            
            var bar = new ProgressBar.Line(this, {
               strokeWidth: 4,
               easing: 'easeInOut',
               duration: 1400,
               color: bar_color,
               trailColor: track_color,
               trailWidth: 8,
               svgStyle: {width: '100%', height: '100%'},
               text: {
                  style: {
                     // Text color.
                     // Default: same as stroke color (options.color)
                     color: percentage_color,
                     position: 'absolute',
                     right: '0',
                     top: '-31px',
                     padding: 0,
                     margin: 0,
                     transform: null
                  },
                  autoStyleContainer: true
               },
               from: {color: '#FFEA82'},
               to: {color: '#ED6A5A'},
               step: (state, bar) => {
                  bar.setText(Math.round(bar.value() * 100) + ' %');
               }
            });
            
            bar.animate(percentage);  // Number from 0.0 to 1.0
            
         });
         
      });
      
   });
   
   
   /* ==================================================
   Circular Progress Bar
   ================================================== */
   
   $(document).ready(function(){ 
      
      $('.pollen-circular-progress-bar-params').each(function(){
         
         $(this).appear(function(){
            
            // Custom Colors
            var percentage_color = $(this).attr('percentage_color');
            var bar_color = $(this).attr('bar_color');
            var track_color = $(this).attr('track_color');
            
            // Thickness
            var bar_thickness = $(this).attr('bar_thickness');
            var track_thickness = $(this).attr('track_thickness');
            
            // Percentage Value
            var percentage = $(this).attr('percentage') / 100;
            
            var bar = new ProgressBar.Circle(this, {
               strokeWidth: bar_thickness,
               easing: 'easeInOut',
               duration: 1400,
               color: bar_color,
               trailColor: track_color,
               trailWidth: track_thickness,
               svgStyle: null,
               text: {
                  style: {
                     // Text color.
                     // Default: same as stroke color (options.color)
                     color: percentage_color,
                     position: 'absolute',
                     right: '0',
                     top: '0px',
                     padding: 0,
                     margin: 0,
                     transform: null
                  },
                  autoStyleContainer: true
               },
               from: {color: '#FFEA82'},
               to: {color: '#ED6A5A'},
               step: (state, bar) => {
                  bar.setText(Math.round(bar.value() * 100));
               }
            });
            
            bar.animate(percentage);  // Number from 0.0 to 1.0
            
         });
         
      });
      
   });
   
   
   /* ==================================================
   Semi Circular Progress Bar
   ================================================== */
   
   $(document).ready(function(){ 
      
      $('.pollen-semi-circular-progress-bar-params').each(function(){
         
         $(this).appear(function(){
            
            // Custom Colors
            var percentage_color = $(this).attr('percentage_color');
            var bar_color = $(this).attr('bar_color');
            var track_color = $(this).attr('track_color');
            
            // Thickness
            var bar_thickness = $(this).attr('bar_thickness');
            var track_thickness = $(this).attr('track_thickness');
            
            // Percentage Value
            var percentage = $(this).attr('percentage') / 100;
            
            var bar = new ProgressBar.SemiCircle(this, {
               strokeWidth: bar_thickness,
               easing: 'easeInOut',
               duration: 1400,
               color: bar_color,
               trailColor: track_color,
               trailWidth: track_thickness,
               svgStyle: null,
               text: {
                  style: {
                     // Text color.
                     // Default: same as stroke color (options.color)
                     color: percentage_color,
                     position: 'absolute',
                     right: '0',
                     top: '0px',
                     padding: 0,
                     margin: 0,
                     transform: null
                  },
                  autoStyleContainer: true
               },
               from: {color: '#FFEA82'},
               to: {color: '#ED6A5A'},
               step: (state, bar) => {
                  bar.setText(Math.round(bar.value() * 100));
               }
            });
            
            bar.animate(percentage);  // Number from 0.0 to 1.0
            
         });
         
      });
      
   });
   
   /* ==================================================
   Modal
   ================================================== */
   
   $(document).ready(function(){ 
      
      var modalBtns = [...document.querySelectorAll(".pollen-modal-button, .pollen-modal-icon, .pollen-modal-text")];
      modalBtns.forEach(function(btn){
         btn.onclick = function() {
            var modal = btn.getAttribute('data-modal');
            document.getElementById(modal).style.visibility = "visible";
            document.getElementById(modal).style.opacity = "1";
            document.getElementById(modal).style.transition = "all 0.25s";
         }
      });
      
      var closeBtns = [...document.querySelectorAll(".pollen-modal-close")];
      closeBtns.forEach(function(btn){
         btn.onclick = function() {
            var modal = btn.closest('.pollen-modal');
            modal.style.visibility = "hidden";
            modal.style.opacity = "0";
         }
      });
      
      window.onclick = function(event) {
         if (event.target.className === "pollen-modal") {
            event.target.style.visibility = "hidden";
            event.target.style.opacity = "0";
         }
      }
      
   });
   
   
}); //End Strict